import React, { useState, useEffect } from 'react';

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [branches, setBranches] = useState(['Main Branch', 'North Wing']);
  const [newBranch, setNewBranch] = useState('');

  // Fetch users from Backend
  useEffect(() => {
    fetch('http://localhost:5000/api/users')
      .then(res => res.json())
      .then(data => setUsers(data));
  }, []);

  const addBranch = () => {
    if(newBranch) {
      setBranches([...branches, newBranch]);
      setNewBranch('');
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6 md:p-12">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-4xl font-black uppercase italic mb-8">Admin <span className="text-gymRed">Dashboard</span></h1>

        {/* Branch Management Section */}
        <div className="bg-white p-6 rounded-xl shadow-md mb-10 border-t-4 border-gymYellow">
          <h2 className="text-xl font-bold mb-4 uppercase">Manage Branches</h2>
          <div className="flex gap-4">
            <input 
              value={newBranch} 
              onChange={(e) => setNewBranch(e.target.value)}
              className="border p-2 rounded flex-1" 
              placeholder="Enter Branch Name" 
            />
            <button onClick={addBranch} className="bg-black text-white px-6 py-2 rounded font-bold">CREATE BRANCH</button>
          </div>
          <div className="mt-4 flex gap-2">
            {branches.map(b => (
              <span key={b} className="bg-gray-200 px-3 py-1 rounded-full text-xs font-bold">{b}</span>
            ))}
          </div>
        </div>

        {/* Payment Verification Table */}
        <div className="bg-white rounded-xl shadow-lg overflow-hidden">
          <div className="p-6 border-b bg-black text-white flex justify-between items-center">
            <h2 className="font-bold uppercase tracking-widest">Pending Payment Approvals</h2>
            <span className="bg-gymRed text-xs px-2 py-1 rounded">Action Required</span>
          </div>
          <table className="w-full text-left">
            <thead className="bg-gray-50 text-gray-500 uppercase text-xs">
              <tr>
                <th className="p-4">Member Info</th>
                <th className="p-4">Branch</th>
                <th className="p-4">Method</th>
                <th className="p-4">Status</th>
                <th className="p-4 text-center">Actions</th>
              </tr>
            </thead>
            <tbody className="divide-y">
              {users.map(user => (
                <tr key={user._id} className="hover:bg-gray-50 transition">
                  <td className="p-4">
                    <div className="font-bold">{user.name}</div>
                    <div className="text-sm text-gray-500">{user.email}</div>
                  </td>
                  <td className="p-4 text-sm font-semibold">{user.branch}</td>
                  <td className="p-4 italic text-gymRed font-bold">{user.paymentMethod}</td>
                  <td className="p-4">
                    <span className={`px-2 py-1 rounded text-[10px] font-black uppercase ${user.status === 'Verified' ? 'bg-green-100 text-green-700' : 'bg-red-100 text-red-700'}`}>
                      {user.status}
                    </span>
                  </td>
                  <td className="p-4 text-center space-x-2">
                    <button className="bg-green-600 text-white px-3 py-1 rounded text-xs font-bold uppercase">Confirm</button>
                    <button className="bg-yellow-400 text-black px-3 py-1 rounded text-xs font-bold uppercase">WhatsApp</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
